 utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;DROP TABLE IF EXISTS `custom_version_form`;CREATE TABLE `custom_version_form`  (  `id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,  `form_json` json NULL,  `deleted` bit(1) NULL DEFAULT NULL,  PRIMARY KEY (`id`) USING BTREE) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;DROP TABLE IF EXISTS `kb_content`;CREATE TABLE `kb_content`  (  `kb_pk` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',  `kb_code` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '知识点编码',  `kb_dir_pk` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '知识点目录主键',  `kb_dir_code` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '知识点目录编码',  `kb_dir_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '知识点目录名称',  `kb_name` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '标题(名称)',  `key_word` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '关键字(多个关键字以逗号分隔)',  `kb_content` longtext CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '知识库具体内容',  `kb_link_code` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '关联知识点编码',  `kb_type_pk` int(11) NOT NULL COMMENT '知识点类型主键',  `kb_type_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '知识点类型名称',  `audit_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '审核人',  `auditman_demo` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '审核人备注',  `auditman_time` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '审核时间',  `url` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '参考资料',  `kb_demo` varchar(2000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '备注',  `kb_count` int(11) NOT NULL DEFAULT 0 COMMENT '搜索次数',  `kb_view_count` int(11) NOT NULL DEFAULT 0 COMMENT '浏览次数',  `create_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人主键',  `create_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,  `create_time` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建时间',  `update_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人名',  `update_user_id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改人主键',  `update_time` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '修改时间',  `approval_status` int(11) NULL DEFAULT NULL,  PRIMARY KEY (`kb_pk`) USING BTREE) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '输入的知识点信息' ROW_FORMAT = Dynamic;DROP TABLE IF EXISTS `kb_directory`;CREATE TABLE `kb_directory`  (  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',  `kb_dir_name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '名称',  `kb_dir_code` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '编码',  `kb_dir_gbcode` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '父编码',  `kb_dir_clevel` int(11) NOT NULL DEFAULT 1 COMMENT '（目录）级别',  `kb_dir_excel_flag` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT 'excel标记',  `create_time` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '创建时间',  PRIMARY KEY (`id`) USING BTREE) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '知识点目录表' ROW_FORMAT = Dynamic;DROP TABLE IF EXISTS `sys_area`;CREATE TABLE `sys_area`  (  `id` int(20) NOT NULL AUTO_INCREMENT COMMENT '区域标识',  `area_code` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '区域