 '创建人',  `level` int(10) NULL DEFAULT 1 COMMENT '级别 1 低 2 中  3 高',  `title` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '标题',  `DELETED` decimal(1, 0) NULL DEFAULT NULL COMMENT '是否删除',  PRIMARY KEY (`id`) USING BTREE) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;DROP TABLE IF EXISTS `sys_config`;CREATE TABLE `sys_config`  (  `id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键',  `config_content` mediumtext CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '配置内容',  `config_type` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '配置类型',  `in_use` int(2) NOT NULL DEFAULT 1 COMMENT '配置状态 1:启用 0：禁用',  `update_time` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '更新时间',  `deleted` decimal(1, 0) NULL DEFAULT NULL,  `type` int(10) NULL DEFAULT 0 COMMENT '0 文本 1 附件',  PRIMARY KEY (`id`) USING BTREE) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '系统配置内容' ROW_FORMAT = Dynamic;DROP TABLE IF EXISTS `sys_data_filter`;CREATE TABLE `sys_data_filter`  (  `ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,  `NAME` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,  `EXPRESSION` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,  `PERMISSION_STR` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,  `URL` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,  `CREATE_USER` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,  `CREATE_TIME` datetime(6) NULL DEFAULT NULL,  `UPDATE_USER` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,  `UPDATE_TIME` datetime(6) NULL DEFAULT NULL,  `DELETED` decimal(1, 0) NULL DEFAULT NULL,  PRIMARY KEY (`ID`) USING BTREE) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;DROP TABLE IF EXISTS `sys_dict_type`;CREATE TABLE `sys_dict_type`  (  `ID` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,  `TYPE_NAME` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '字典类型名称',  `TYPE_CODE` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '字典类型编码',  `TYPE_DESC` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '字典类型描述',  `CREATE_USER` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,  `CREATE_TIME` datetime(6) NULL DEFAULT NULL,  `UPDATE_USER` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,  `UPDATE_TIME` datetime(6) NULL DEFAULT NULL,  `DELETED` decimal(1, 0) NULL DEFAULT NULL,  PRIMARY KEY (`ID`) USING BTREE) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;DROP TABLE IF EXISTS `sys_email`;CREATE TABLE `sys_email`  (  `id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,  `deliver` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '发送人s',  `receiver` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '接收人',  `receiver_user_id` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,  `keys` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,  `carbon_copy` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '抄送人',  `subject` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '邮件主题',  `text` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '内容',  `type` int(255) NOT NULL DEFAULT 1 COMMENT '类型 1文本邮件  2 html邮件 3发送含附件，但不含嵌入html静态资源页面的邮件 4发送含附件，且含嵌入html静态资源页面的邮件 5 发送thymeleaf模板邮件',  `file_id` int(11) NOT NULL COMMENT '附件ID',  `create_user` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '创建人',  `create_time` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '创建时间',  `send_time` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '发送时间',  `state` int(10) NULL DEFAULT 0 COMMENT ' 发送状态 0 未发送 1 发送成功  2 发送失败',  `DELETED` decimal(1, 0) NULL DEFAULT NULL COMMENT '是否删除',  PRIMARY KEY (`id`) USING BTREE) ENGINE = InnoDB CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Dynamic;DROP TABLE IF EXISTS `sys_file_attach`;CREATE TABLE `sys_file_attach`  (  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '附件标识id',  `file_name` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '附件名称',  `file_path` varchar(500) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '附件存放路径',  `create_time` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '创建时间',  `ext` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '附件类型 后缀名',  `file_type` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '文件存放分类',  `note` varchar(1024) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '附件大小 KB',  `user_id` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '创建人标识',  `usr_name` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '创建人姓名',  `total_bytes` double NULL DEFAULT 0 COMMENT '附件大小 字节',  `category` varchar(32) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '附件所属父类文件夹',  `old_file_name` varchar(256) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL COMMENT '原始文件名',  PRIMARY KEY (`id`) USING BTREE) ENGINE = InnoDB AUTO_INCREMENT = 1 CHARACTER SET = utf8 COLLATE = utf8_general_ci COMMENT = '附件表' ROW_FORMAT = Dynamic;DROP TABLE IF EXISTS `sys_info`;CREATE TABLE `sys_info`  (  `id` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '主键',  `deleted` bit(1) NOT NULL DEFAULT b'0' COMMENT '删除标